import "./App.css";
import { Route, Switch } from "react-router-dom";
import {
  Navbar,
  Homepage,
  SignIn,
  Mypage,
  CryptoWorld,
} from "./components/main";
import { useEffect, useState } from "react";
import axios from "axios";

function App() {
  const [Map, SetMap] = useState(false);
  useEffect(async () => {
    await axios
      .get("http://localhost:8080/Map/AllMap")
      .then((a) => console.log(a.data));
  });

  return (
    <div className="App">
      <Navbar />
      <Switch>
        <Route exact path="/">
          <Homepage />
        </Route>
        <Route path="/SignIn">
          <SignIn />
        </Route>
        <Route path="/MyPage">
          <Mypage />
        </Route>
        <Route path="/CryptoWorld">
          <CryptoWorld />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
